import React, { useState, useEffect } from "react";

function Total() {
  const [info, setInfo] = useState(null);
  const [confirmed, setConfirmed] = useState(0);
  const [recovered, setRecovered] = useState(0);
  const [deaths, setDeaths] = useState(0);
  useEffect(() => {
    fetch("https://covid-19-data.p.rapidapi.com/totals?format=json", {
      method: "GET",
      headers: {
        "x-rapidapi-host": "covid-19-data.p.rapidapi.com",
        "x-rapidapi-key": "1d4a63eb5dmshedfd7c1ab6075cep1a20bfjsnee48c2d9b899",
      },
    })
      .then((response) => response.json())
      .then((responseJson) => console.log(responseJson))
      .catch((err) => {
        console.log(err);
      });
  }, [setInfo]);
  return (
    <div>
      {info && <h1>WORLD COUNT: {info.body}</h1> && (
          <h1>Confirmed: {info.confirmed}</h1>
        ) && <h1>recovered: {info.recovered}</h1> && (
          <h1>Deaths: {info.deaths}</h1>
        )}
    </div>
  );
}
export default Total;
